import React, { useState } from "react";
import { Paper, Grid } from "@material-ui/core";
import { useSpring, animated } from "react-spring";

function Dots({ slides, activeSlide }: any) {
  const [a, seta] = useState(0);
  //
  //
  //
  //USE SLIDE DOWN ANIMATION FROM REACT SPRING
  const animationDots = useSpring({
    config: {
      duration: 250,
    },

    backgroundColor:
      activeSlide === a ? "rgba(255,255,255,0.8)" : "rgba(255,255,255,0.3)",
    padding: "7px",
    marginRight: "5px",
    cursor: "pointer",
    borderRadius: "50%",
  });

  return (
    <Grid
      container
      style={{
        position: "relative",
        bottom: "6vh",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        zIndex: 2,
      }}
    >
      {slides.map((slide: any, i: any) => (
        <>
          {seta(i)}
          <>
            <animated.span
              className="turdark"
              key={slide}
              style={animationDots}
            ></animated.span>
          </>
        </>
      ))}
    </Grid>
  );
}

export default Dots;
